                            ObraID = 1,
                            CategoriaID = 1,
                            Descripcion = "¿Hasta que punto nos somete la tecnología? ¿Somos libres? ¿Qué tipo de sociedad hemos construido entre todos? ¿Cómo se nos plantea el futuro? ¿Nos merecemos el calificativo de \"seres humanos\"? \r\n\r\nAdictos trata de dar respuesta a estos interrogantes que abordan problemáticas que nos afectan a todos. Cuestiones que no acostumbramos a ver subidas en un escenario que ahora se confrontan con el público contemporáneo. \r\n\r\nLas personas solemos asumir ciertos paradigmas y cuestiones como válidos y ciertos sin siquiera plantearnos las mentiras y distorsiones que pueden esconder detrás. En un mundo en el que la desinformación se expande, el personaje de Estela y su transformación constituirá una metáfora de la disposición del ser humano para cambiar de actitud. Un texto que reivindica y reflexiona sobre la capacidad de reacción de las personas y que enseña que un punto de rebeldía es necesario cuando queremos cambiar algo. \r\n\r\nLola Herrera, Ana Labordeta y Lola Baldrich protagonizan un espectáculo que grita... ¡Adictos somos todos!",
