                        },
                        new
                        {
                            ObraID = 2,
                            CategoriaID = 1,
                            Descripcion = "Mentiras, verdades, ilusiones y la educación que recibimos desde pequeños... \r\n\r\nLaponia es una comedia de Cristina Clemente y Marc Angelet que convierte una velada de fiesta e ilusión en una batalla entre hermanas, parejas y cuñados. Una obra que nos hará pensar y reír a la vez que nos planteará diferentes situaciones éticas y morales que nos podrían pasar a todos. ¿La verdad es tan buena como dicen y la mentira tan mala?\r\n\r\nLaponia es el lugar en el que dos familias se encuentran con la intención de celebrar la Nochebuena y la llegada de Papá Noel. Todo parece ir bien hasta que una de las criaturas explica al otro que Papá Noel no existe, y que es un personaje que ha sido creado para que los padres puedan controlar a sus hijos y hacer que se comporten bien.\r\n\r\nA partir de aquí, las dos parejas se enzarzan en una discusión sobre la verdad y la mentira, las costumbres y los valores familiares, y comienzan a salir a la luz varias verdades ocultas. ¿Qué secreto inconfesable tiene cada uno de ellos? ¡Descúbrelo tú mismo!",
                            Imagen = "https://cd1.taquilla.com/data/images/t/8e/laponia__330x275.jpg",
                            Titulo = "Laponia"
                        },
                        new
                        {
                            ObraID = 3,
                            CategoriaID = 0,
                            Descripcion = "Tras el éxito cosechado con La Gran Ilusión, uno de los mayores espectáculos de magia de nuestro país, el Mago Pop llega de nuevo para mostrarnos los mejores trucos de ilusionismo en su nuevo espectáculo Nada es imposible. Y es que es innegable que Antonio Díaz ha sabido sacarle partido a lo que mejor sabe hacer, y no ha dudado en demostrar que el arte de la magia puede ser exhibido tanto en los teatros como en televisión.\r\n\r\nNada es Imposible es un espectáculo en el que magia y humor se fusionan para hacernos pasar una velada de lo más original. Con el único objetivo de sorprender al público, este experto en magia ha preparado entre un gran secretismo  unos de sus shows más creativos hasta el momento, en el que no dudará en hacer uso de la innovación y la fantasía. Antonio Díaz nos invita a un así a hacer un recorrido por lo extraordinario, donde el asombro, la diversión y las sorpresas no terminarán nunca.\r\n\r\nLa historia de Antonio Díaz es la historia de la sorpresa, de la ilusión. De la pequeña pantalla pasó al teatro, para convertirse en el mago más taquillero de toda Europa. Conocido internacionalmente, este Premio Nacional de Magia llega dispuesto a repetir el éxito de sus anteriores espectáculos y demostrarnos que verdaderamente, nada es imposible.",
                            Imagen = "https://cd1.taquilla.com/data/images/t/78/nada-es-imposible-el-mago-pop__330x275.jpg",
                            Titulo = "Nada es Imposible - el Mago pop"
                        },
                        new
                        {
                            ObraID = 4,
                            CategoriaID = 2,
                            Descripcion = "Cristina Clemente y Marc Angelet son los autores de 'Una Terapia Integral', la comedia que trata de retratar a una sociedad que parece estar eliminando la religión, pero que a su vez tiene una gran necesidad de creer, tener fe en algo que nos ayude a encontrar sentido a nuestras vidas y a poner orden en ellas. Un curso intensivo con cuatro magníficos intérpretes Antonio Molero, Angy Fernández, Esther Ortega y César Camino.\r\n\r\n¿Una corteza poco crujiente? Problemas laborales ¿Una miga demasiado densa? Crisis de pareja ¿Un pan soso? Una vida sexual insatisfactoria.\r\n\r\nTodos quieren apuntarse a los cursos de hacer pan que imparte Toni Roca. Sus diez años de experiencia y las pocas plazas ofertadas hacen que la gente haga cola para apuntarse. Para el maestro, \"somos el pan que hacemos\" y su curso garantiza que, después de unas cuantas sesiones, el alumno será capaz de hacer un pan excelente. Lo curioso de su sistema de aprendizaje es que los alumnos no solo tendrán que amasar o controlar la temperatura del horno: también deberán sincerarse, llorar, reír, gritar... y liberarse. \r\n\r\nToni Roca tiene clara su premisa: “Para hacer un buen pan, no hace falta la mejor harina o la levadura más fresca, para hacer un buen pan solo es necesario estar bien con uno mismo”. ",
                            Imagen = "https://cd1.taquilla.com/data/images/t/18/una-terapia-integral-madrid__330x275.jpg",
                            Titulo = "Una Terapia Integral Madrid"
                        },
                        new
                        {
                            ObraID = 5,
                            CategoriaID = 2,
                            Descripcion = "Lola es una camarera Sevillana, cansada, frustrada y enfadada con la vida. Periodista frustrada y portadora de la mala suerte, aguanta cada día a los borrachos del trabajo con resignación y todo el sentido del humor que puede. Sin embargo, de tanto recordar su mala suerte y de tanto blasfemar, un día en un arrebato se acuerda hasta de la mísmisima virgen.\r\n\r\nHasta que La Virgen se le aparece. Y descubre que no son mujeres tan diferentes.\r\n\r\nEsta comedia arrolladora e incesante es un auténtico símbolo del teatro de humor en nuestro país: más de diez años de programación a sus espaldas lo corroboran. Interpretada por Lola Marmolejo en el papel de La Virgen y Rocío Galán como camarera, de la compañía Bastarda Española, es una apuesta segura si lo que estás buscando es una tarde de carcajadas.\r\n\r\n¡No te la pierdas!",
                            Imagen = "https://cd1.taquilla.com/data/images/t/f8/estrella-sublime__330x275.jpeg",
                            Titulo = "Estrella Sublime"
                        },
                        new
                        {
                            ObraID = 6,
                            CategoriaID = 1,
                            Descripcion = "Una compañía de teatro amateur quiere presentar al público su primera obra: una función de misterio al más puro estilo Agatha Christie, y estamos todos invitados. Sin embargo, montar un gran espectáculo es más complicado, y todo lo que podría salir mal parece que hoy está dispuesto a fallar.\r\n\r\nY es que los actores que hacen de muertos se mueven más de lo debido, el atrezzo se cae a cachos, el guión se les olvida, la dirección es un desastre, la iluminación falla... Una consecución de desaciertos que convierten el estreno en una hilarante comedia con reminiscencias al estilo Monthy Python.\r\n\r\nLa función que sale mal ha hecho partirse de risa a más de 8 millones de espectadores desde su estreno en el West End en Londres (2012), acumulando los mayores premios en su categoría, y sigue agotando localidades cada día. También ha triunfado en Broadway y ha sido presentada en 30 países. ¡Ahora puedes disfrutar de ella en Madrid!",
                            Imagen = "https://cd1.taquilla.com/data/images/t/3d/la-funcion-que-sale-mal__330x275.jpg",
                            Titulo = "La Función que Sale mal"
                        },
                        new
                        {
                            ObraID = 7,
                            CategoriaID = 0,
                            Descripcion = "Norma Aleandro dirige Escenas de la vida conyugal, una versión teatral de la película homónima de Ingmar Bergman, que desde su presentación cosechó varios e importantísimos premios como el Golden Globe y el BAFTA. En 1981, Bergman estrenó la primera adaptación teatral en el teatro Marstall de Munich (Alemania) y desde entonces ha sido un éxito en numerosos países.\r\n\r\nRicardo Darín y Andrea Pietra dan vida respectivamente a Juan y Marina, una pareja que representa sobre el escenario momentos clave en su matrimonio. A lo largo de la obra, se exploran temas como el amor, la comunicación, la infidelidad, la rutina y el paso del tiempo. La historia sigue la evolución de la relación desde los primeros días de amor apasionado hasta las dificultades y desafíos que enfrenta la pareja a medida que transcurren los años.\r\n\r\nLa narrativa atemporal y la sinergia entre actores y personajes rompen la cuarta pared, sumergiendo a la audiencia en un juego emotivo y reflexivo sobre el matrimonio y la vida: situaciones aparentemente divertidas que dentro ocultan un profundo dramatismo. Escenas de la vida conyugal ha sido elogiada por su profundidad psicológica y su capacidad para conectar con el público a través de la identificación con los personajes. Así, ha recibido 4 premios Estrella de Mar y el prestigioso Premio José María Vilches, una distinción que honra a las obras que destacan por su contribución a la dignidad humana y los valores sociales.",
